import React from 'react';
import { Link } from 'react-router-dom';
import './RSA.css';

const Homepage: React.FC = () => {
    return (
        <div className="homepage">
            <h1>Welcome to Encryption Tool</h1>
            <Link to="/rsa">
                <button>Go to RSA Encryption</button>
            </Link>
        </div>
    );
};

export default Homepage;
